import React from 'react';

import { UncontrolledCarousel } from 'reactstrap';

const items = [
  {
    src: 'http://image.noelshack.com/fichiers/2018/41/3/1539165890-deezer.jpeg',
    altText: 'Slide 1',
    caption: 'Slide 1',
    header: 'Slide 1 Header'
  },
  {
    src: 'http://image.noelshack.com/fichiers/2018/41/3/1539165944-msc.png',
    altText: 'Slide 2',
    caption: 'Slide 2',
    header: 'Slide 2 Header'
  },
];

const Example = () => <UncontrolledCarousel items={items} />;

export default Example;
